// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "./ERC6551Account.sol";
import "./TicketExtended.sol";
import "./HeroToken.sol";
import "./interfaces/ITicket.sol";

error NonexistentToken(uint256 _tokenId);
error NotOwner(uint256 _tokenId, address sender);
error AlreadyRegistered(string _ownerAddress, string _nftAddress);
error InSufficientBalance(
    address _sender,
    uint256 _senderBalance,
    uint256 _amount
);
error PaymentFailed(address _sender, address _recipient, uint256 _amount);

contract Ticket is Ownable, ITicket, ERC721URIStorage {
    uint256 private _tokenIds;

    ERC6551Account private _ercAccount;

    TicketExtended private _ticketExtended;

    HeroToken private _token;

    uint256 remainTicketAmount;

    address adminAddress;

    uint256 ticketPrice;

    string baseTokenURI;

    constructor(
        address _ticketExtendedAddress,
        address _tokenAddress,
        string memory ticketName,
        string memory ticketSymbol,
        string memory ticketUri,
        address initialOwner,
        uint256 ticketAmount,
        uint256 _ticketPrice
    ) ERC721(ticketName, ticketSymbol) Ownable(initialOwner) {
        _ticketExtended = TicketExtended(_ticketExtendedAddress);
        _token = HeroToken(_tokenAddress);
        remainTicketAmount = ticketAmount;
        adminAddress = initialOwner;
        ticketPrice = _ticketPrice;
        baseTokenURI = ticketUri;
    }

    // WhiteList(신원 인증완료된 사람)
    mapping(address => bool) public _whiteList;

    function buyTicket(address buyer) external payable returns (uint256) {
        require(remainTicketAmount > 0, "No more ticket");
        require(_whiteList[buyer], "recipient is not in white list");

        address tbaAddress = _ticketExtended._tbaAddress(buyer);

        require(tbaAddress != address(0x00), "");

        // 티켓결제
        withdraw(buyer, adminAddress, ticketPrice);

        // 티켓 수량 감소
        remainTicketAmount = remainTicketAmount - 1;

        // ticketExtended에 _ticketAddresses[tbaAddress]에 구매할 티켓 컨트랙트 주소 추가
        _ticketExtended.updateTicketAddresses(buyer, address(this));
        uint256 newTicketId = _mintTicket(tbaAddress, baseTokenURI);
        emit TicketBuy(buyer, newTicketId, baseTokenURI);
        return newTicketId;
    }

    // 구매자의 지갑(TBA)로 티켓 전송
    function transferTicket(uint256 _tokenId, address _buyer) public {
        require(
            ownerOf(_tokenId) == msg.sender,
            "Not the owner of this ticket"
        );
        require(_whiteList[msg.sender], "Not White List Member");

        safeTransferFrom(msg.sender, _buyer, _tokenId);
        emit TicketTransferred(_tokenId, msg.sender, _buyer);
    }

    function updateWhiteList(address to) public returns (bool) {
        if (_whiteList[to] == true) {
            return false;
        } else {
            _whiteList[to] = true;
            emit WhiteListUpdated(to);
            return true;
        }
    }

    // 결제 대금 인출하는 함수
    function withdraw(
        address sender,
        address recipient,
        uint256 amount
    ) internal {
        require(recipient == adminAddress, "recipient is not admin");

        uint256 senderBalance = _token.balanceOf(sender);
        if (senderBalance < amount) {
            revert("Insufficient balance");
        }

        // approve된 금액 확인, 만약 amount보다 작다면 그만큼 approve
        // uint256 allowance = _token.allowance(sender, recipient);
        // if (allowance < amount) {
        //     _token.approve(recipient, amount);
        // }

        // TransferFrom
        _token.transferFrom(sender, recipient, amount);
    }

    function isAddressInWhiteList(
        address recipient
    ) external view returns (bool) {
        return _whiteList[recipient];
    }

    function _mintTicket(
        address _to,
        string storage _tokenURI
    ) internal returns (uint256) {
        uint256 newTicketId = _tokenIds;
        _tokenIds++;
        _mint(_to, newTicketId);
        _setTokenURI(newTicketId, _tokenURI);
        return newTicketId;
    }
}

contracts/TicketExtended.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ERC6551Account.sol";
import "./ERC6551Registry.sol";
import "./NFTFactory.sol";
import "./interfaces/ITicket.sol";
import "./interfaces/ITicketExtended.sol";
import "./Ticket.sol";

// error 정의

contract TicketExtended is Ownable(msg.sender), ITicketExtended {
    uint256 private _tokenIds;

    ERC6551Registry private _registry;
    ERC6551Account private _account;
    NFTFactory private _nftFactory;
    Ticket private _ticket;

    constructor() {
        _nftFactory = new NFTFactory();
        _account = new ERC6551Account();
        _registry = new ERC6551Registry();
    }

    // tbaAddress mapping 추가
    mapping(address => address) public _tbaAddress;
    // 티켓 주소 배열(소유자 주소 => 보유중인 티켓 컨트랙트 주소 배열)
    mapping(address => address[]) public _ticketAddresses;

    // NFT Factory로 부터 Hero Ticket NFT 생성 및 TBA 생성
    function mint(
        address to,
        string memory tokenURI
    ) external payable returns (uint256, address) {
        if (_tbaAddress[to] != address(0x00)) {
            revert("TBA is already exist");
        }
        uint256 tokenId = _tokenIds;
        _tokenIds++;

        uint256 salt = generateRandomSalt();

        // TBA account 생성
        address accountAddress = _registry.createAccount(
            address(_account),
            bytes32(salt),
            block.chainid,
            address(_nftFactory),
            tokenId
        );

        address expectAddress = _registry.account(
            address(_account),
            bytes32(salt),
            block.chainid,
            address(_nftFactory),
            tokenId
        );

        require(accountAddress == expectAddress, "Account creation failed");

        uint256 newNFTId = _nftFactory.mintNFT(to, tokenURI);
        _tbaAddress[to] = accountAddress;

        emit minted(tokenId);
        return (newNFTId, accountAddress);
    }

    function updateTicketAddresses(
        address buyer,
        address newTicketAddress
    ) external {
        _ticketAddresses[buyer].push(newTicketAddress);
    }

    // emit event
    function issueTicket(
        address _ticketExtendedAddress,
        address _tokenAddress,
        string memory ticketName,
        string memory ticketSymbol,
        string memory ticketUri,
        address initialOwner, // 관리자
        uint256 ticketAmount,
        uint256 ticketPrice
    ) external onlyOwner returns (address) {
        _ticket = new Ticket(
            _ticketExtendedAddress,
            _tokenAddress,
            ticketName,
            ticketSymbol,
            ticketUri,
            initialOwner, // 관리자
            ticketAmount,
            ticketPrice
        );
        address ticketAddress = address(_ticket);
        return ticketAddress;
    }

    // emit event
    function buyTicket(
        address _ticketAddress
    ) external payable returns (uint256) {
        _ticket = Ticket(_ticketAddress);
        require(
            _ticket._whiteList(msg.sender),
            "recipient is not in white list"
        );
        uint256 newTicketId = _ticket.buyTicket(msg.sender);
        return newTicketId;
    }

    function updateWhiteList(address _ticketAddress, address to) external {
        _ticket = Ticket(_ticketAddress);
        _ticket.updateWhiteList(to);
    }

    // ownTicket
    function ownedTicket() external view returns (address[] memory) {
        return _ticketAddresses[msg.sender];
    }

    function generateRandomSalt() internal view returns (uint256) {
        bytes32 hash = keccak256(
            abi.encodePacked(block.timestamp, msg.sender, _tokenIds)
        );
        return uint256(hash);
    }
}

